$(document).ready(function () {
  $.ajax({
    url: 'http://127.0.0.1:5000/api/hours/total',
    xhrFields: { withCredentials: !0 }
  }).then(function (t) {
    $('.hours-total').append(t.total_hours)
  })
}),
$(document).ready(function () {
  $.ajax({
    url: 'http://127.0.0.1:5000/api/hours/month',
    xhrFields: { withCredentials: !0 }
  }).then(function (t) {
    $('.hours-month').append(t.month_hours)
  })
})
